import React from 'react';

// CSS
import classes from './Menu.module.css';

// Component
const Menu = () => (
    <div className={classes.Menu}>
        <p>Kontakt</p>
        <ul>
            <li>office@novinarnica.net</li>
            <li>+381 11 26 97 573</li>
            <li>Branka Pešića 53</li>
            <li>11080 Zemun, Beograd</li>
        </ul>
    </div>
);

// Export
export default Menu;
